import React from 'react';
import EventCard from './EventCard';
import './CardGrid.css';

const CardGrid = ({ campaigns }) => {
  return (
    <div className="card-grid-container">
      {campaigns.map(campaign => (
        <EventCard key={campaign.id} campaign={campaign} />
      ))}
    </div>
  );
};

export default CardGrid;
